import React, { useState } from "react";
const SpeakerSchedule = ({ speakerSchedule }) => {
  if (!speakerSchedule) {
    return <p>Loading...</p>;
  }

  return (
    <div>
      <h2>Speaker Schedule</h2>
      <ul>
        {speakerSchedule.map((speaker, index) => (
          <li key={index}>{speaker.name} - {speaker.time}</li>
        ))}
      </ul>
    </div>
  );
};


export default SpeakerSchedule;
